import React from 'react';
import './Body.css';

function Body(props){
    return(
        <div className="bodyEstilo">
            <div className="bodyEncabezado">
                <p>{props.tituloPractica}</p>
            </div>
            <div >
                {props.arreglo.map(txt => <p>{txt}</p>)}
            </div>
        </div>
    );
}

export default Body;
